// Updated renderProperties function to filter by type and city
function renderProperties(typeFilter = "all", cityFilter = "all") {
  const list = document.getElementById("property-list");
  list.innerHTML = "";

  const filtered = properties.filter(p => 
    (typeFilter === "all" || p.type === typeFilter) &&
    (cityFilter === "all" || p.city === cityFilter)
  );

  filtered.forEach(prop => {
    const card = document.createElement("div");
    card.className = "property-card";
    card.innerHTML = `
      <img src="${prop.image}" alt="${prop.title}" />
      <div class="content">
        <h3>${prop.title}</h3>
        <p><strong>${prop.price}</strong></p>
        <p>${prop.city} - ${prop.type}</p>
      </div>
    `;
    list.appendChild(card);
  });

  if(filtered.length === 0){
    list.innerHTML = "<p>No properties found matching your criteria.</p>";
  }
}

function filterProperties() {
  const type = document.getElementById("type-filter").value;
  const city = document.getElementById("city-filter").value;
  renderProperties(type, city);
}

// Add event listeners on your filter dropdowns
document.getElementById("type-filter").addEventListener("change", filterProperties);
document.getElementById("city-filter").addEventListener("change", filterProperties);

// Initial render
renderProperties();


card.innerHTML = `
  <!-- other property details -->
  <button class="buy-btn" onclick="buyProperty()">Buy Now</button>
`;

